// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract SkillVerification {

    // Structure to represent a skill
    struct Skill {
        string skillHash;        // IPFS hash of the skill document
        address certifier;       // Address of the certifier (who submitted the skill)
        address verifier;        // Address of the verifier (who verified the skill)
        string issuingOrganization;  // Name of the organization issuing the certificate
        bool isVerified;         // Whether the skill has been verified or not
    }

    // Mapping from user address to a list of skills
    mapping(address => Skill[]) public userSkills;

    // Event emitted when a new skill is submitted
    event SkillSubmitted(address indexed user, string skillHash, string issuingOrganization);

    // Event emitted when a skill is verified
    event SkillVerified(address indexed user, string skillHash, address verifier);

    // Function to submit a skill
    function submitSkill(string memory _skillHash, string memory _issuingOrganization) public {
        // Create the skill struct and add it to the user's skill list
        Skill memory newSkill = Skill({
            skillHash: _skillHash,
            certifier: msg.sender,     // The sender of the transaction is the certifier
            verifier: address(0),      // Initially, no verifier
            issuingOrganization: _issuingOrganization,
            isVerified: false          // Skill is not verified at the time of submission
        });

        // Add the skill to the users skill list
        userSkills[msg.sender].push(newSkill);

        // Emit an event for the submission of the skill
        emit SkillSubmitted(msg.sender, _skillHash, _issuingOrganization);
    }

    // Function to verify a skill
    function verifySkill(address _user, uint _skillIndex) public {
        // Ensure the skill index is valid
        require(_skillIndex < userSkills[_user].length, "Invalid skill index");

        // Fetch the skill and mark it as verified
        Skill storage skillToVerify = userSkills[_user][_skillIndex];
        require(!skillToVerify.isVerified, "Skill already verified");

        // Set the verifier and mark the skill as verified
        skillToVerify.verifier = msg.sender;
        skillToVerify.isVerified = true;

        // Emit an event for the verification of the skill
        emit SkillVerified(_user, skillToVerify.skillHash, msg.sender);
    }

    // Function to get all verified skills for a user
    function getVerifiedSkills(address _user) public view returns (Skill[] memory) {
        // Initialize a temporary array for storing verified skills
        uint verifiedCount = 0;
        for (uint i = 0; i < userSkills[_user].length; i++) {
            if (userSkills[_user][i].isVerified) {
                verifiedCount++;
            }
        }

        // Create an array for verified skills
        Skill[] memory verifiedSkills = new Skill[](verifiedCount);
        uint index = 0;
        for (uint i = 0; i < userSkills[_user].length; i++) {
            if (userSkills[_user][i].isVerified) {
                verifiedSkills[index] = userSkills[_user][i];
                index++;
            }
        }

        return verifiedSkills;
    }

    // Function to get all skills for a user (both verified and unverified)
    function getAllSkills(address _user) public view returns (Skill[] memory) {
        return userSkills[_user];
    }
}
